A frontend for r_egg. ragg2 compiles programs written in a simple high-level language into tiny binaries for x86, x86-64, and ARM. Examples $ cat hi.r
/* hello world in r_egg */
write@syscall(4); //x64 write@syscall(1);
exit@syscall(1); //x64 exit@syscall(60); main@global(128) { .var0 = "hi!\n"; write(1,.var0, 4); exit(0);
}
$ ragg2 -O -F hi.r
$ ./hi
hi! $ cat hi.c
main@global(0,6) { write(1, "Hello0", 6); exit(0);
}
$ ragg2 hi.c
$ ./hi.c.bin
Hello

